import React, {Component} from 'react';
import Link from 'next/link';
import Head from 'next/head';
import '../test.scss';


class Navbar extends Component {
	render(){
		return (
		<nav class="db dt-l w-100 border-box pa3 ph5-l myNav" style="background: rgb(72, 61, 139);"><a id="home" class="db dtc-l v-mid mid-gray link dim w-100 w-25-l tc tl-l mb2 mb0-l" title="Home" href="/"><img src="/static/media/astronaut.402f22dd.jpg" class="dib w2 h2 br-100" alt="Site Name"/></a><div class="db dtc-l v-mid w-100 w-75-l tc tr-l"><a id="about" class="link dim  f6 f5-l dib mr3 mr4-l" title="About" href="/about" style="color: rgb(255, 165, 0);">About Me</a><a class="link dim  f6 f5-l dib mr3 mr4-l" title="Skills" href="/skill" style="color: rgb(255, 165, 0);">My Skills</a><a id="projects" class="link dim  f6 f5-l dib mr3 mr4-l" title="Projects" href="/project" style="color: rgb(255, 165, 0);">Projects</a></div></nav>
		)
	}
}  

export default Navbar;
